-- Prepare conversion data
--
-- Table structure for table `chr_customization_conversion`
--
DROP TABLE IF EXISTS `chr_customization_conversion`;
CREATE TABLE `chr_customization_conversion` (
  `ID` int NOT NULL,
  `RaceMask` bigint unsigned DEFAULT NULL,
  `ClassMask` int unsigned DEFAULT NULL,
  `Sex` int DEFAULT NULL,
  `OptionID` int DEFAULT NULL,
  `Data` int DEFAULT NULL,
  `ChrCustomizationOptionID` int DEFAULT NULL,
  `ChrCustomizationChoiceID` int DEFAULT NULL,
  `DependentOptionID` int DEFAULT NULL,
  `DependentData` int DEFAULT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

--
