--
-- Table structure for table `character_customizations`
--
DROP TABLE IF EXISTS `character_customizations`;
CREATE TABLE `character_customizations` (
  `guid` bigint(20) unsigned NOT NULL,
  `chrCustomizationOptionID` int(10) unsigned NOT NULL,
  `chrCustomizationChoiceID` int(10) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`guid`,`chrCustomizationOptionID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- Skin
SELECT c.guid, ccc.ChrCustomizationOptionID, ccc.ChrCustomizationChoiceID
FROM characters c
INNER JOIN chr_customization_conversion ccc ON c.skin = ccc.`Data` AND (ccc.RaceMask & (1 << (c.race - 1))) <> 0 AND c.gender = ccc.Sex AND (ccc.ClassMask & (1 << (c.class - 1))) <> 0
WHERE ccc.OptionID = 1 AND ccc.DependentOptionID = 0;

-- Face
SELECT c.guid, ccc.ChrCustomizationOptionID, ccc.ChrCustomizationChoiceID
FROM characters c
INNER JOIN chr_customization_conversion ccc ON c.face = ccc.`Data` AND (ccc.RaceMask & (1 << (c.race - 1))) <> 0 AND c.gender = ccc.Sex AND (ccc.ClassMask & (1 << (c.class - 1))) <> 0
WHERE ccc.OptionID = 2 AND ccc.DependentOptionID <> 1;

SELECT c.guid, ccc.ChrCustomizationOptionID, ccc.ChrCustomizationChoiceID
FROM characters c
INNER JOIN chr_customization_conversion ccc ON c.face = ccc.`Data` AND (ccc.RaceMask & (1 << (c.race - 1))) <> 0 AND c.gender = ccc.Sex AND (ccc.ClassMask & (1 << (c.class - 1))) <> 0
WHERE ccc.OptionID = 2 AND ccc.DependentOptionID = 1 AND ccc.DependentData = c.skin;

