UPDATE `characters` SET `level`=COALESCE((SELECT `NewLevel` FROM `chr_level_conversion` WHERE `OldLevel`=`level`), `level`);

ALTER TABLE `characters`
  DROP `skin`,
  DROP `face`,
  DROP `hairStyle`,
  DROP `hairColor`,
  DROP `facialStyle`,
  DROP `customDisplay1`,
  DROP `customDisplay2`,
  DROP `customDisplay3`;

ALTER TABLE `corpse`
  ADD `race` tinyint(3) unsigned NOT NULL DEFAULT '0' AFTER `itemCache`,
  ADD `gender` tinyint(3) unsigned NOT NULL DEFAULT '0' AFTER `race`;

UPDATE `corpse` SET `race`=(`bytes1`>>8)&255, `gender`=(`bytes1`>>16)&255;

ALTER TABLE `corpse`
  DROP `bytes1`,
  DROP `bytes2`;

--
-- Table structure for table `corpse_customizations`
--
DROP TABLE IF EXISTS `corpse_customizations`;
CREATE TABLE `corpse_customizations` (
  `ownerGuid` bigint(20) unsigned NOT NULL,
  `chrCustomizationOptionID` int(10) unsigned NOT NULL,
  `chrCustomizationChoiceID` int(10) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`ownerGuid`,`chrCustomizationOptionID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

SELECT cc.guid, cc.chrCustomizationOptionID, cc.chrCustomizationChoiceID
FROM `character_customizations` cc
INNER JOIN `corpse` c ON cc.`guid` = c.`guid`;

